import Input from "../Input";
import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";

const SearchForm = () => {
    return (
        <>
        <section class="hero is-primary">
        <div class="hero-body">
            <p class="title">
            Primary hero
            </p>
            <p class="subtitle">
            Primary subtitle
            </p>
        </div>
        </section>
        </>
    );
}

export default SearchForm;
